DROP TABLE IF EXISTS master.district;

CREATE TABLE master.district (
id integer NOT NULL primary key,
code integer NOT NULL UNIQUE,
state_code integer NOT NULL,
name character varying(255) NOT NULL,
census_code_2001 character varying(2) NOT NULL,
census_code_2011 character varying(4) NOT NULL,
is_active boolean NOT NULL,
is_deleted boolean NOT NULL,
created_by bigint NOT NULL,
created_on timestamp without time zone NOT NULL,
updated_by bigint NOT NULL,
updated_on timestamp without time zone NOT NULL,
FOREIGN KEY (state_code) REFERENCES master.state(code)
);

